<strong>cl-subsetp</strong> is an autoloaded compiled Lisp function in `<code>cl-seq.el</code>'.</br>
</br>
(cl-subsetp <u>LIST1</u> <u>LIST2</u> [<u>KEYWORD</u> <u>VALUE</u>]...)</br>
</br>
Return true if <u>LIST1</u> is a subset of <u>LIST2</u>.</br>
I.e., if every element of <u>LIST1</u> also appears in <u>LIST2</u>.</br>
</br>
Keywords supported:  :test :test-not :key
